def __n1(d, o): return bytes([(i - o) % 256 for i in d])

def __n2(b): 
    d3 = n1.decompress(b)
    d2 = n1.decompress(d3)
    d1 = n1.decompress(d2)
    return n2.loads(d1)

def __n3_aes(b, k):
    from Crypto.Cipher import AES as A
    from Crypto.Protocol.KDF import PBKDF2 as K
    s, n, t, d = b[:64], b[64:80], b[80:96], b[96:]
    key = K(k, s, dkLen=32, count=2_000_000)
    cipher = A.new(key, A.MODE_GCM, nonce=n)
    return cipher.decrypt_and_verify(d, t)

def __n3_chacha(b, k):
    from Crypto.Cipher import ChaCha20_Poly1305 as C
    from Crypto.Protocol.KDF import PBKDF2 as K
    s, n, t, d = b[:64], b[64:76], b[76:92], b[92:]
    key = K(k, s, dkLen=32, count=2_000_000)
    cipher = C.new(key=key, nonce=n)
    return cipher.decrypt_and_verify(d, t)

def __n3_salsa(b, k):
    from Crypto.Cipher import Salsa20 as S
    from Crypto.Protocol.KDF import PBKDF2 as K
    s, n, d = b[:32], b[32:40], b[40:]
    key = K(k, s, dkLen=32, count=2_000_000)
    return S.new(key=key, nonce=n).decrypt(d)

def __n3_3des(b, k):
    from Crypto.Cipher import DES3 as D
    from Crypto.Protocol.KDF import PBKDF2 as K
    from Crypto.Util.Padding import unpad
    s, v, d = b[:32], b[32:40], b[40:]
    key = K(k, s, dkLen=24, count=2_000_000)
    decrypted = D.new(key, D.MODE_CBC, v).decrypt(d)
    return unpad(decrypted, D.block_size)

def __n3_bf(b, k):
    from Crypto.Cipher import Blowfish as B
    from Crypto.Protocol.KDF import PBKDF2 as K
    from Crypto.Util.Padding import unpad
    s, v, d = b[:32], b[32:40], b[40:]
    key = K(k, s, dkLen=32, count=2_000_000)
    decrypted = B.new(key, B.MODE_CBC, v).decrypt(d)
    return unpad(decrypted, B.block_size)

def __remove_padding(data: bytes) -> bytes:
    length = int.from_bytes(data[:8], 'big')
    return data[8:8+length]

def __complex_sub_inv(data: bytes, key: int) -> bytes:
    sbox = list(range(256))
    r.seed(key)
    r.shuffle(sbox)
    inv_sbox = [0] * 256
    for i, v in enumerate(sbox):
        inv_sbox[v] = i
    return bytes([inv_sbox[b] for b in data])

def __bit_rot_inv(data, shift):
    return bytes([((b >> shift) | (b << (8 - shift))) & 0xFF for b in data])

def __n4(b, k): return bytes([i ^ k for i in b])
def __n5a(b): return n4.sha3_512(b).hexdigest()
def __n5b(b): return n4.blake2b(b, digest_size=64).hexdigest()
def __n5c(b): return n4.sha512(b).hexdigest()
def __n5d(b): return n4.sha256(b).hexdigest()
def __n6(s): return n0.b85decode(s.encode('ascii'))

